<?php
namespace FN\FOUNDATION;
/**
 * returns arg
 *
 * @param  mixed $arg
 * @return argument
 */
function id($arg)
{
    return $arg;
}

/**
 * Composes functions.
 *
 * Composes function right to left, output of right function
 * is input to left function
 *
 * @param  function [ $fs]
 * @return function
 */

function compose(...$fs)
{
        $start = count($fs) -1;
        return function ($arg=null) use ($start,$fs) {
                $res = $fs[$start]($arg);
            while($start--){
                    $res = call_user_func($fs[$start], $res);
            }
                return $res;
        };
}


/**
 * Sequences functions.
 *
 * Sequences functions left to right, output of left function
 * is input to right function
 *
 * @param  function [ $fs]
 * @return function
 */

function sequence($f1, ...$fs)
{
        $fin = function ($arg) use ($f1) {
                return call_user_func($f1, $arg);
        };
    foreach( $fs as $f ){
            $fin = function ($arg) use ($fin,$f) {
                    return call_user_func($f, $fin($arg));
            };
    }
        return $fin;
}

/**
 * Partial function application
 * 
 * Applies given paramter(s) to provided function and returns a function 
 * that can be called with remaining parameters. The initial call to this
 * function defines the argument list.
 *
 * function f($a,$b,$c="default"){..}
 * $f = partial('f','A_arg'         ) -> $f has arity=1, expecting 2nd param, using default value
 * $f = partial('f',NS,      'B_arg') -> $f has arity=1, expecting 1st param, using default value
 * $f = partial('f','A_arg', 'B_arg') -> $f has arity=0, using default value
 * $f = partial('f','A_arg', 'B_arg', 'newdef') -> $f has artity=0, using new value for default
 * $f = partial('f',NS, NS, 'newdef') -> $f has arity=2, using new value for default
 *
 * @param  callable       $func
 * @param  [list of args]
 * @return Closure
 */

function partial($FN)
{
    $as = func_get_args();
    return  (new Partial(array_shift($as), $as))->close();
}

/**
 * $f = function(a,b){return $a + $b;};
 * $fcurried = curry($f);
 * -- call with both args
 * $res = $f(1,2) // returns 3
 * -- call with one arg , return new function that takes
 * -- remaining args
 * $func_takes_second_arg = $fcurried(1); // return new function
 * $res = $func_takes_second_arg(2) // returns 3
 *
 * can call curry with as many arguments as necessary
 * function take3($a,$b,$c){ ... }
 * $take3 = curry('take3','Aarg','Barg') // returns function with two args alread supplied
 * $res = $take3('Carg');
 *
 * @param  callable $somefunction
 * @param  mixed[] ... 0 to arity number of function args
 * @return callable Returns curried callable
 */
function curry($FN)
{
    $as = func_get_args();
    return  (new Curry(array_shift($as), $as))->close();
}

